import React from 'react';

const SearchBar = () => {
  return (
    <div className="row g-3 align-items-stretch">
      <div className="col">
        <select className="form-select h-100" aria-label="Default select example">
          <option selected>Open this select menu</option>
          <option value="1">One</option>
          <option value="2">Two</option>
          <option value="3">Three</option>
        </select>
      </div>
      <div className="col">
        <input type="text" placeholder="Search..." className="form-control h-100" />
      </div>
      <div className="col">
        <button type="button" className="btn btn-primary h-100">Search</button>
      </div>
    </div>
  );
};

export default SearchBar;
